const Content = () =>{

    return(

        <>

                <div className="box_center">
                     
                  <div className="content">
                    <div>
                        <input type="text" placeholder="Title" className="title" />
                    </div>
                    <textarea>Content</textarea>
                    <button className="button"><AddIcon /></button>
                </div>            
                      
            </div>



        </>
    );
}
export default Content;
